import Link from 'next/link';

const PostCard = (props,handleClick) => {
    const {postTitle,postMainImage,postCreationDate,postBody} = props.children.fields

    return(
        <div onClick = {handleClick}>
            <div>
                <img src = {postMainImage.fields.file.url}/>
            </div>
            <h2>{postTitle}</h2>
            <h3>{postCreationDate}</h3>
        </div>
    )
  };

  export default PostCard
